def sd(x):
    return sum(map(int, str(x)))


def ans(x):
    print(x)
    return


def hardcode_solver(a):
    if a == 2:
        ans(6)
    if a == 4:
        ans(75)
    if a == 8:
        ans(125)


def powers_of_10(x):
    if 10 ** 18 % x == 0:
        ans(-1)


def single_test(x, drange):
    found = False
    for d in drange:
        t = 10 ** d // x + 1
        ad = sd(t) - sd(t * x) * x
        if ad > 0:
            print(x, d, ad)
            found = True
            break
    if not found:
        print(x, 'Failed')
        return


def test1(x):
    plus = None
    minus = None
    ir = [1, 2, 11]
    ir = [1, 2, 11, 9, 99, 999]
    for d in range(1, 6400, 1):
        for i in ir:
            t = i * 10 ** d // x + 1
            ad = sd(t) - sd(t * x) * x
            if ad > 0:
                if ad < 40:
                    plus = (i, d, ad)
            elif -ad < 40:
                minus = (i, d, -ad)
            if plus != None and minus != None:
                print(x, *plus, *minus)
                return True
    return False


